#include <iostream>
#include <vector>
#include <queue>
using namespace std;

class Solution
{
public:
	int minKBitFlips(vector<int>& nums, int k)
	{
		int result = 0;
		queue<int> flips;
		
		for (auto i = 0; i < nums.size(); ++i)
		{
			// we check whether the number is double flipped
			// if so if the number is not equal to 1 we flip
			if (nums[i] != (flips.size() % 2 ? 0 : 1))
			{
				++result;
				// put the end index the latest flip to the queue
				flips.push(i + k - 1);
			}
			// If the front element is out of changed bits scope we pop it
			if (!flips.empty() && flips.front() <= i)
				flips.pop();
		}
		// if we flipped more elements than we can pop
		// it means that we flipped the bits larger than the given array
		return flips.empty() ? result : -1;
	}
};

